import { StyleSheet, css } from "aphrodite";
import React from "react";

const Home = () => {
	return <div className={css(classes.root)}></div>;
};

const classes = StyleSheet.create({
	root: {
		position: "relative",
		backgroundColor: "#1C1B1B",
		width: "100%",
		height: "100vh",
	},
});

export default Home;
